import React from "react";
import ReactDOM from "react-dom";
import App from "./components/app/App";
import {BrowserRouter} from "react-router-dom";
import "./style/style.scss";


ReactDOM.render(
    <React.StrictMode>
        <BrowserRouter>
            <App/>
        </BrowserRouter>
    </React.StrictMode>,
    document.getElementById("root")
);
